import LocomotiveScroll from "locomotive-scroll";

const scroll = new LocomotiveScroll({
  el: document.querySelector("[data-scroll-container]"),
});
let bgColor;

const nav = document.querySelector("nav");
nav.classList.add("scrolled");
const hero = document.querySelector(".hero");
const sideNavBtn = document.querySelector(".nav--circl");
const navCircl = document.querySelector(".nav--circl");
const logo = document.querySelector(".logo svg");
const pointColorChange =
  hero.getBoundingClientRect().bottom - window.scrollY - 200;
const skillsSection = document.querySelector(".skills--section");
const skillsContainer = document.querySelector(".skills");
const skills = skillsContainer.querySelectorAll(".skill");
const bgProgress = document.querySelector(".bg--animation");
console.log(skills);
console.log(pointColorChange);
const navObserver = new IntersectionObserver(
  function (entries) {
    entries.forEach((entry) => {
      nav.classList.toggle("scrolled");
      sideNavBtn.classList.remove("active");
      console.log("sds");
    });
  },
  {
    rootMargin: "-95% 0px 0px 0px",
  }
);
navObserver.observe(hero);
// changeing background color based on the section
const navBarBgColor = new IntersectionObserver(
  function (entries) {
    entries.forEach((entry) => {
      console.log(entry);
      if (!entry.isIntersecting) {
        nav.style.setProperty("--bg-color", "var(--main-color)");
        navCircl.style.backgroundColor = "#fff";
        navCircl.style.setProperty("--bg-lines", "var(--main-color)");
        logo.style.fill = "#fff";
        bgProgress.style.opacity = "1";
      } else {
        nav.style.removeProperty("--bg-color", "var(--main-color)");
        navCircl.style.backgroundColor = "var(--main-color)";
        navCircl.style.setProperty("--bg-lines", "#fff");
        bgProgress.style.opacity = "0";
        logo.style.fill = "var(--main-color)";
      }
    });
  },
  {
    threshold: 0,
    rootMargin: "-200px 0px 0px 0px",
  }
);
navBarBgColor.observe(hero);
const navLinks = document.querySelectorAll("nav > .links .nav--links  li");
console.log(navLinks);
navLinks.forEach((link, i) => {
  link.style.setProperty("--x", i);
});

const flipTextElements = document.querySelectorAll("[text-flip]");
flipTextElements.forEach((ele) => {
  addFlipAnimation(ele);
  console.log(ele);
});
console.log(flipTextElements);
function addFlipAnimation(ele) {
  const eleText = ele.innerText;
  ele.innerHTML = `<span class="text">${eleText}</span>`;
  ele.setAttribute("content", eleText);

  // ele.appendChild(clone);
}

sideNavBtn.addEventListener("click", () => {
  sideNavBtn.classList.toggle("active");
  sideNavBtn.classList.toggle("closed");
  document.body.classList.toggle("hidden");
  console.log(document.body);
  console.log("saa");
});
console.log("saa");

function changeColor(start, end) {
  const startR = start[0];
  const startG = start[1];
  const startB = start[2];

  const progres = Math.min(window.scrollY / pointColorChange, 1);
  const currentR = [startR + (end[0] - startR) * progres];
  const currentG = [startG + (end[1] - startG) * progres];
  const currentB = [startB + (end[2] - startB) * progres];

  bgColor = `rgb(${currentR}, ${currentG}, ${currentB})`;
  document.body.style.backgroundColor = bgColor;
  hero.style.backgroundColor = bgColor;
  nav.style.setProperty("--bg-color", bgColor);
  skillsContainer.style.setProperty("--bg-color", bgColor);
}
window.addEventListener("scroll", () => {
  changeColor([249, 246, 246], [9, 38, 53]);
});
skills.forEach((skill) => {
  skill.addEventListener("click", (e) => {
    if (e.target.classList.contains("close")) {
      console.log("Close Element");
      skill.classList.remove("active");
      skillsContainer.classList.remove("animation");
      return;
    }
    console.log("ds");
    const left =
      skill.getBoundingClientRect().left -
      skillsContainer.getBoundingClientRect().left;
    console.log(left);
    const top =
      skill.getBoundingClientRect().top -
      skillsContainer.getBoundingClientRect().top;
    const width = skill.getBoundingClientRect().width;
    skill.style.setProperty("--width", width + "px");
    console.log(skill.getBoundingClientRect());
    console.log(skillsContainer.getBoundingClientRect());
    skill.style.setProperty("--left", left + "px");
    skill.style.setProperty("--top", top + "px");
    skill.classList.add("active");
    skillsContainer.classList.add("animation");
  });
});
const projectsContainer = document.querySelector(".projects");

const projects = document.querySelectorAll(".project");
const projectVeiwer = document.querySelector(".projects--viewer");
// Project Vewier Width and height to center it around the cursor
const projectVeiwerWidth = projectVeiwer.getBoundingClientRect().width / 2;
const projectVeiwerHeight = projectVeiwer.getBoundingClientRect().height / 2;
// projectVeiwer.style.maxWidth = 0;
const projectVeiwerDiv = document.querySelector(".projects--viewer > div");
projectsContainer.getBoundingClientRect().top;
console.log(projectsContainer.getBoundingClientRect().top);
projects.forEach((project, i) => {
  project.addEventListener("mouseover", () => {
    projectVeiwerDiv.style.setProperty(
      "--translateY",
      i * (-100 / projectVeiwerDiv.children.length) + "%"
    );
  });
});
projectsContainer.addEventListener("mouseenter", (e) => {
  projectVeiwer.classList.add("active");
  const yPosition = Math.max(
    projectsContainer.getBoundingClientRect().top +
      e.clientY -
      projectVeiwerHeight
  );
  const xPosition = Math.max(
    e.clientX -
      projectsContainer.getBoundingClientRect().left -
      projectVeiwerWidth
  );
  projectVeiwer.style.setProperty("--x", xPosition + "px");
  projectVeiwer.style.setProperty("--y", yPosition + "px");
  projectVeiwer.style.setProperty("--scale", 1);
});
projectsContainer.addEventListener("mouseleave", (e) => {
  projectVeiwer.style.setProperty("--scale", 0);
  projectVeiwer.classList.remove("active");
  console.log("ss");
});
projectsContainer.addEventListener("mousemove", (e) => {
  console.log("mouse Position ==> ", e.clientY);

  const yPosition = e.clientY;
  // console.log("mouseMove=>>", yPosition);
  const xPosition = e.clientX;
  projectVeiwer.style.setProperty("--x", xPosition + "px");
  projectVeiwer.style.setProperty("--y", yPosition + "px");
});

// addProject("name", "role", "./images/projects/portfolio.jpg");
const box = document.querySelector(".box");
const cercil = document.querySelector(".cercil");
const cercilReduis = cercil.computedStyleMap().get("width").value / 2;
const boxWidth = box.computedStyleMap().get("width").value;

document.addEventListener("scroll", (e) => {
  const boxPresintg = Math.min(
    window.scrollY / (document.body.clientHeight - window.innerHeight),
    1
  );

  const boxY = cercilReduis * boxPresintg * 2;
  console.log(boxY);
  const boxX =
    Math.sqrt(cercilReduis ** 2 - (boxY - cercilReduis) ** 2) + cercilReduis;
  console.log(boxX);
  box.style.setProperty("--boxY", boxY + "px");
  box.style.setProperty("--boxX", boxX + "px");
});
